import React from 'react'
import './SectionSimple.css'

export const Section = (props) => {
  //

  return (
    <section className="section-grid">
      <div style={leftBlockStyle} className="left-block">
        {props.leftBlock}
      </div>
      <div style={textBlockStyle} className="central-block">
        {props.centerBlock}
      </div>
      <div style={rightBlockStyle} className="right-block">
        {props.rightBlock}
      </div>
    </section>
  )
}
